This text is written in the Quechua language and it can be translated to English as follows:

"The road that goes through the mountains is very long, my friend. It has 5,000 curves and we have to go around them carefully. The road is narrow and winding, with many turns and bends. We must drive slowly and carefully so we don't fall off the cliff. There are 3,755 meters of altitude difference between here and the other side of the mountain range.";

Response:  Kutichiy:  Chaymanjina, imatachus ruwasun chayta tʼukurisun. 

Translation: "Today I have 25 oranges and 1 lemon left in the house, 20% of which are for you. There are also 2 apples left. Do you want some oranges?"

In this example, the speaker is informing the listener about their current inventory of fruits (orange and lemon) and offering some to the listener. The use of percentages (20%) and quantities (2 apples) provides additional context for the listener regarding the quantity of fruits available.;

