This text is written in the Quechua language and it can be translated as follows:

"Soloqa here, I am studying sciences (nisqa) book 4 pages long, sociology (nisqa) book 20 pages long, history (nisqa) book 7 pages long, geography (nisqa) book 8 pages long. Soloqa, on Monday next week there are 15 days left until the end of the semester. Imaraykuchus, do you want to know how many credits we have earned so far? Chay tapuymanjina, unfortunately, we don't have enough time. Rikun: Let's calculate our grades together. Qanchispa: We have earned 30 credits for completing courses, 20 credits for passing exams, 10 credits for participating in discussions, 5 credits for attending classes, 10 credits for submitting assignments, 5 credits for presenting projects, 10 credits for participating in group work, and 5 credits for completing final evaluations.";

