This text is written in the Aymara language and it can be translated as follows:

"Billyqa, my grandfather, told me that when he was young, there were many potatoes here (points to a place). He said that they used to plant them in the springtime, around May or June, and then harvest them in August or September. They would dig up the potatoes with their hands and eat them right away. My grandfather also said that sometimes they would find big potatoes with eyes on them, which they called 'ch'iya'. And he added that if you want to know how many potatoes are left in the ground, count the number of eyes you see on each one.";

